package p1705

import "testing"

func Test_countHomogenous(t *testing.T) {
	type args struct {
		s string
	}
	tests := []struct {
		name string
		args args
		want int
	}{
		{
			name: "Example 1",
			args: args{
				s: "abbcccaa",
			},
			want: 13,
		},
		{
			name: "Example 2",
			args: args{
				s: "xy",
			},
			want: 2,
		},
		{
			name: "Example 3",
			args: args{
				s: "zzzzz",
			},
			want: 15,
		},
		{
			name: "WA 1",
			args: args{
				s: "",
			},
			want: 49965,
		},
	}
	for _, tt := range tests {
		t.Run(tt.name, func(t *testing.T) {
			if got := countHomogenous(tt.args.s); got != tt.want {
				t.Errorf("countHomogenous() = %v, want %v", got, tt.want)
			}
		})
	}
}
